import React, { useState } from 'react';
import './App.css';
import { Route, Link, BrowserRouter as Router, Switch, Redirect } from 'react-router-dom'
import Login from './Login';
import GuardedRoute from 'react-guarded-route'
import { Navbar, Nav } from 'react-bootstrap'
import Menu from './Menu'


const IsUserLogged = (checkIfSignedIn) => {
  let isUserSigned = sessionStorage.getItem('userLoggedIn')
  return checkIfSignedIn ? isUserSigned !== null : isUserSigned === null
}

const UnauthenticatedRoutes = () => {
  return (
    <div>
      <Route exact path='/' component={Home} />
      <Route path='/login' component={Login} />          
    </div>
  )
}

const AuthenticatedRoutes = () => {
  return (
    <div>
      <Route exact path='/' component={Home}  />
      <Route path='/about' component={About}  />      
    </div>
  )
}

function App() {
  console.log(IsUserLogged(true));
  return (
    <Router>
      <Switch>
        {IsUserLogged(true) ? AuthenticatedRoutes() : UnauthenticatedRoutes() }
        <Redirect to={'/notfound'}/>
      </Switch>

    </Router>
  );
}

function About() {
  return (
    <div>
      <h1>About</h1>
    </div>
  )
}

function Home() {
  return (
    <div>
      <h1>Home</h1>
    </div>
  )
}

export default App;
